('CSC 110', 'Software Design and Programming I', 'This course introduces a set of fundamental design principles and problem-solving techniques for the development of computer\r\nalgorithms and their implementation as programs. Problem solutions are developed with the help of an appropriate modeling language and\r\nthen coded in an object-oriented programming language. (Consult the Computer Science Department for the languages and tools currently\r\nin use.) Topics such as problem specification, object-oriented analysis and design, standard data types, control structures, methods and\r\nparameter passing, and design for reuse are presented through a study of specific example problems and solutions. Style, documentation,\r\nsolution robustness, and conformance with specifications are emphasized throughout. Three lecture hours and three hours of scheduled\r\nlaboratory per week plus extensive programming work outside of class. Not open to students who have received credit for CSC 201J');

